var urlShortener=new Vue({el:"#url-shortener",data:{createdUrl:"",errors:[],url:"",canSubmit:!0},methods:{create:function(){let n=this;if(n.canSubmit===!0){if(n.errors=[],n.createdUrl="",!n.url){n.errors.push("URL is required");return}if(!n.validUrl(n.url)){n.errors.push("URL is not valid");return}n.canSubmit=!1;axios.post("/api/shortenedUrls/",{url:this.url}).then(function(t){console.log(t);n.createdUrl=t.data}).catch(function(t){n.errors.push(t)}).finally(function(){n.canSubmit=!0})}},validUrl:function(n){return/(http|https):\/\/(\w+:{0,1}\w*@)?(\S+)(:[0-9]+)?(\/|\/([\w#!:.?+=&%@!\-\/]))?/.test(n)}},created:function(){}});